import React, { useState } from "react";
import { Grid, Paper, Typography, CardHeader, IconButton, Button } from "@material-ui/core";
import '@fontsource/roboto';
import FacebookIcon from '@material-ui/icons/Facebook';
import EmailIcon from '@material-ui/icons/Email';
import LocalPhoneIcon from '@material-ui/icons/LocalPhone';

const Contact = () => {

    const [phoneState, setPhoneState] = useState(false)
    //Style
    const style = {
        card: {
            marginTop: 5,
            marginBottom: 0,
            paddingTop: 20,
            paddingBottom: 40,
            backgroundColor: "#A9D1EA",
            color: "white",
            borderRadius: 5
        },
        emailIcon: {
            color: "white",
            position: "flex",
            alignItems: "right",
        },
        facebookIcon: {
            color: "white",
            position: "flex",
            alignItems: "left",
        },
        phoneIcon: {
            color: "white",
            position: "flex",
            alignItems: "left",
        }
    }
    return (
        <Grid container direction="row">
            <Grid item md="12" xs="12">
                <Paper style={style.card} elevation="5">
                    <CardHeader title="Contact" />
                    <Grid container direction="row" alignItems="center">
                        <Grid item md="4" xs="12">
                            <Typography>Email: loveyourbirthmidwifery@gmail.com</Typography>
                        </Grid>
                        <Grid item md="1" xs="4">
                            <IconButton>
                                <EmailIcon style={style.emailIcon}/>
                            </IconButton>
                        </Grid>
                        <Grid item md="1" xs="4">
                            <IconButton>
                                <FacebookIcon  style={style.facebookIcon}/>
                            </IconButton>
                        </Grid>
                        <Grid item md="1" xs="4">
                            <IconButton onClick={() => setPhoneState(true)}>
                                <LocalPhoneIcon style={style.phoneIcon} />
                            </IconButton>
                            {(!phoneState) ? <Typography></Typography> : <Typography>Phone: (859) 620-2982</Typography>}
                        </Grid>
                        <Grid item md="4" xs="3">
                            <Button>Patient Portal Login</Button>
                        </Grid>
                    </Grid>
                </Paper>
            </Grid>
        </Grid>
    )
}

export default Contact;
